import React from 'react';
import ClubForm from './ClubForm';
import { useState } from 'react';

function ClubDetail({ pickedClub, register, setRegister }) {


    return (
        <div className='lg:w-3/5 w-5/5 rounded p-2 overflow-hidden shadow-[0_2px_10px] shadow-blackA7 bg-slate-800 border text-white'>
            <h1 className='text-center text-2xl mb-1'>
                {pickedClub.name} kul端b端
            </h1>
            <p className='text-sm'>
                {pickedClub.description}
            </p>

            {register ? <ClubForm /> :
                <div className='text-center mt-6' onClick={() => setRegister(true)}>
                    <button class="btn btn-success">Kaydolmak ister misin?</button>
                </div>}


        </div>
    )
}

export default ClubDetail
